import React from "react";
import { Modal, TextField, Button } from "@mui/material";

const IncomeModal = ({ open, onClose }) => {
  return (
    <Modal
      open={open}
      onClose={onClose}
      sx={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        backgroundColor: "rgba(239, 239, 239, 0.85)",
      }}
    >
      <div
        style={{
          backgroundColor: "#fff",
          padding: "20px",
          width: "538px",
          height: "164px",
        }}
      >
        <h3 style={{fontWeight:"700", fontSize:'30px'}}>Add Balance</h3>
        <TextField size="small" placeholder="Income Amount" onChange={(e) => console.log(e.target.value)} sx={{backgroundColor:"rgba(217, 217, 217, 1)", color:"rgba(145, 145, 145, 1)"}} />
        <Button variant="contained">Add Balance</Button>
        <Button variant="outlined" onClick={onClose}>
          Cancel
        </Button>
      </div>
    </Modal>
  );
};

const ExpenseModal = () => {
  return <div></div>;
};

export { IncomeModal, ExpenseModal };
